import BgLogin from '../assets/bgLogin.svg';
import LoginForm from '../components/Login/Form';

function Login() {

    const divStyle = {
        backgroundImage: `url(${BgLogin})`,
        backgroundRepeat: 'no-repeat',
        backgroundSize: 'cover',
        width: '100%',
        height: '100%',
    };

    return (
        <div style={divStyle}>
            <h1>Loving Devs</h1>
            <LoginForm/>
        </div>
    )
}

export default Login;
